import { Link } from 'react-router-dom';

const PetMedicalRecord = ({ record }) => {
    return (
        <div className="record">
            <h2 className="recordTitle">{ record.date }</h2>
            <ul className="recordList">Clinic: { record.clinic }</ul>
            <ul className="recordList">Address: { record.address }</ul>
            <ul className="recordList">Phone: { record.phone }</ul>
            <ul className="recordList">Doctor: { record.doctor }</ul>
            <ul className="recordList">Reason: { record.agenda }</ul>
        </div>    
    )
}

export default PetMedicalRecord
